- input: "TEXT\x1CC00167130\x1CTEXT-00001\x1C\x1CF3XN\x1CThis Report discloses payments
    for salary or wages in regard to Federal Election Activity on Line 30b.  Please
    note that the employees that were disclosed on Schedule H4 supporting Line 21(a)
    as payroll spent less than 25% of their time during the period working on any
    Federal Election Activity or activities in connection with a Federal Election
    therefore salary payments were allocable.  This also includes fringe benefits
    for those specific employees.  -   The Memo Schedule A's that itemize the committees
    share of the gross contributions received through the joint fundraising activities
    from the ASDC Dollars for Democrats, ASDC Partnership Program (Association of
    State Democratic Chairs), ASDC Victory Fund, Committee for Change and the Democratic
    National Committee State Party Victory Fund are provided on a quarterly basis.
    The transfer of the joint fundraising proceeds received during this reporting
    period from the ASDC Dollars for Democrats, ASDC Partnership, Committee for Change
    and Democratic National Committee State Party Victory Fund programs represents
    the committee's share of proceeds for contributions received during this or prior
    reporting periods. The memo entries for these contributions are included in this
    or a prior report of the committee.  -  Please note that the report does not contain
    fourth quarter memo entries from Committee for Change, a joint fundraising committee
    in which our committee was a participant. These schedules are not available as
    a result of technical and medical issues at the Democratic National Committee
    computer office which was responsible for managing the data on behalf of the joint
    fundraising committee. It is our understanding that the memo entries will be available
    by the end of February."
